(15, 'Muere Burt Reynolds, leyenda del cine de los años 70', 'Burt Reynolds, frágil y sacudido por el tiempo', 'Es evidente que la enfermedad y los achaques han hecho mella en Burt Reynolds(81). Hace dos años apareció en la convención Wizard World Comic de Filadelphia con aspecto demacrado y con el tiempo no han mejorado las cosas. De hecho, necesitó la ayuda de Robert De Niro y Chevy Chase para llegar hasta la alfombra roja del festival de cine de Tribeca durante este fin de semana en Nueva York, con dificultades para caminar.Una vez allí, atendió a los medios de comunicación para hablar de su última película, Dog Years, una suerte de reflejo de su propia realidad, sentado en una silla que le instalaron en pleno pasillo de personalidades para poder aguantar. A los 81 años, Reynolds, el que fuera leyenda en Hollywood de los 70 y considerado un sex symbol en el mundo occidental, sigue luciendo un aspecto frágil, muy delgado, protegido por una gafas tintadas de un color rosado y ayudado por un bastón.Quizá por eso sus apariciones en público han sido muy escasas en los últimos años, por unos problemas de salud que, de acuerdo a varios medios estadounidenses, son diversos y están acabando poco a poco con su vida.Pero Reynolds no se rinde. Pese a esas serias limitaciones en esta última etapa de su vida, el veterano actor aún no ha querido colgar los guantes. &amp;#34;Me emocionó mucho cuando Burt me llamó al día siguiente y me dijo que se apuntaba&amp;#34;, indicó el director y guionista Adam Rifkin sobre su más reciente filme, que protagoniza Reynolds junto a Chevy Chase, Ariel Winter y Nikki Blonsky.El realizador reconoció en su paso por Tribeca que la cinta estaba específicamente escrita para su héroe de la infancia y que para lograr convencer el actor octogenario le envío el guión plagado de referencias a su propia filmografía, famoso por cintas como Los caraduras o Boogie Nights.', 'http://www.elmundo.es/cultura/2018/09/06/5b917b7646163fcb6f8b46ac.html', '2018-09-06', '', '', 1, 1),
